int countPairs(int** coordinates, int coordinatesSize, int* coordinatesColSize, int k) {
    int count = 0;
    unsigned int x, y, dist;
    for (int i = 0; i < coordinatesSize - 1; i++) {
        for (int j = i + 1; j < coordinatesSize; j++) {
            x = coordinates[i][0] ^ coordinates[j][0];
            y = coordinates[i][1] ^ coordinates[j][1];
            dist = x + y;
            if (dist == k) count++;
        }
    }
    return count;
}
